import React, { Component,Fragment } from 'react';


class ShowPlayers extends Component {
  constructor(props){
    super(props)
    this.state = {
      players : props.location.state.playersInGame
    }
  }
  render() {
    const player = this.state.players.map(elem => (
      {
        name: elem.name,
        lastname: elem.lastname,
        total_time: elem.total_time,
        total_distance: elem.total_distance,
        sprint_distance: elem.sprint_distance,
        total_sprint: elem.total_sprint,
        sprint_avg: elem.sprint_avg

      } 
    ));
    console.log(player)
    let index = 0;
    return (
      <Fragment>
        <table>
        <thead>
        <th>Player Name</th>
          <th>Last Name</th>
          <th>Total Time</th>
          <th>Distance (km)</th>
          <th>Sprint Distance</th>
          <th> Total Sprints</th>
          <th>Sprints Avg(MP/H).</th>
        </thead>
        {player.map(item => (

            <td key={item}>
              {item}
            </td>
        ))}

        </table>
      </Fragment>
    )
  }
}
export default ShowPlayers;
